CREATE TABLE ho_khau(
   so_ho_khau         VARCHAR(6) NOT NULL PRIMARY KEY
  ,id_chu_ho          VARCHAR(6) NOT NULL
  ,dia_chi            VARCHAR(75) NOT NULL
  ,thoi_gian_xac_thuc DATE  NOT NULL
  ,id_nguoi_xac_thuc  INTEGER  NOT NULL
  ,trang_thai         VARCHAR(13) NOT NULL
  ,ghi_chu            VARCHAR(183)
  ,ten_chu_ho         VARCHAR(19) NOT NULL
);
